import styled from "styled-components";

const Timer = () => {
	return (
		<StyledTimer>
			<p id="hours">01</p>
			<p>:</p>
			<p id="minutes">00</p>
			<p>:</p>
			<p id="seconds">00</p>
		</StyledTimer>
	);
};

export default Timer;
